import "./App.css";
import NavBar from "../components/NavBar";
import SideBar from "../components/SideBar";
import ProfileCard from "../components/ProfileCard";

function Home() {
  return (
    <div className="app-wrapper">
      <NavBar />
      <SideBar />
      <div className="viewport">
        <div className="main-content">
        </div>
      </div>
    </div>
  );
}

export default Home;
